import React from 'react';
import './collection.styles.scss';
import { connect } from 'react-redux';

const BrandCollection = ({ match }) => {
  console.log(match);
  return <div className='collection-page'>YES BRAND PAGE</div>;
};

const mapStateToProps = (state, ownProps) => ({
  collection: selectCollection(ownProps.match.params.collectionId)(state),
  genderedCollection: selectCollectionGender(
    ownProps.match.params.collectionId,
    ownProps.match.params.genderId
  )(state),
});

export default connect(mapStateToProps)(BrandCollection);
